description:
 With his father away, Keiran Lee is asked to not only take care of his stepmother, Yasmin Scott, but to help with chores and the upkeep of the house. Keiran does not want to help out Yasmin, that is until she offers to make it worth his while. While cleaning the entire house together, the two also get a little dirty, with both giving into their temptation for one another and soon they fuck around the house. You know what they say: when dad is away, the stepmom will play! 
